import React from "react";
import styles from "./styles.module.css";
import { Button, Form, FormGroup, Label, Input, FormText } from "reactstrap";

function form() {
  return (
    <form>
      <FormGroup>
        <Label for="exampleEmail">Email</Label>
        <Input
          type="email"
          name="email"
          id="exampleEmail"
          placeholder="with a placeholder"
        />
      </FormGroup>
    </form>
  );
}

export default form;
